import React from 'react'
import { Link } from "react-scroll";

function About() {
    return (
        <div className='about-div'>
            <div className='about-title-div'>
                <p>About Me</p>
            </div>
            <div className='about-blurb-div'>
                <p>I'm Ed Miles. I've been working in finance in London for several years now. Most of my spare time I've spent learning to code and now I've decided to turn my passion into a career.</p>
                <p></p>
            </div>
            <div className='about-link-div'>
                <Link className='about-link'
                        activeClass="active"
                        to="tech-skills-div"
                        spy={false}
                        smooth={true}
                        offset={-40}
                        duration={1000}
                    >Technical Skills...<p><i className="fas fa-chevron-circle-down"></i></p>
                </Link>
            </div>
        </div>
    )
}

export default About
